import Cards from "./Cards";
import Data from "./Data"

function CardsList(){
    return(
        <div className="cards_list">
            <Cards 
                imgsrc = {Data[0].imgsrc}
                heading = {Data[0].heading}
                name = {Data[0].name}
                link = {Data[0].link}
            /> 

            <Cards 
                imgsrc = {Data[1].imgsrc}
                heading = {Data[1].heading}
                name = {Data[1].name}
                link = {Data[1].link}
            /> 

            <Cards 
                imgsrc = {Data[2].imgsrc}
                heading = {Data[2].heading}
                name = {Data[2].name}
                link = {Data[2].link}
            /> 

            <Cards 
                imgsrc = {Data[3].imgsrc}
                heading = {Data[3].heading}
                name = {Data[3].name}
                link = {Data[3].link}
            /> 

            <Cards 
                imgsrc = {Data[4].imgsrc}
                heading = {Data[4].heading}
                name = {Data[4].name}
                link = {Data[4].link}
            /> 

            <Cards 
                imgsrc = {Data[5].imgsrc}
                heading = {Data[5].heading}
                name = {Data[5].name}
                link = {Data[5].link}
            />

            <Cards 
                imgsrc = {Data[6].imgsrc}
                heading = {Data[6].heading}
                name = {Data[6].name}
                link = {Data[6].link}
            />

            <Cards 
                imgsrc = {Data[0].imgsrc}
                heading = {Data[0].heading}
                name = {Data[0].name}
                link = {Data[0].link}
            />

            <Cards 
                imgsrc = {Data[0].imgsrc}
                heading = {Data[0].heading}
                name = {Data[0].name}
                link = {Data[0].link}
            />

            <Cards 
                imgsrc = {Data[0].imgsrc}
                heading = {Data[0].heading}
                name = {Data[0].name}
                link = {Data[0].link}
            />


        </div>
    )
}
export default CardsList
